    public class func drawCredit() {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let color = UIColor(red: 0.817, green: 0.036, blue: 0.036, alpha: 1.000)

        //// Star Drawing
        CGContextSaveGState(context)
        CGContextTranslateCTM(context, 17, 17)
        CGContextScaleCTM(context, 0.5, 0.4)

        var starPath = UIBezierPath()
        starPath.moveToPoint(CGPointMake(0, -25))
        starPath.addLineToPoint(CGPointMake(6.4, -8.81))
        starPath.addLineToPoint(CGPointMake(23.78, -7.73))
        starPath.addLineToPoint(CGPointMake(10.35, 3.36))
        starPath.addLineToPoint(CGPointMake(14.69, 20.23))
        starPath.addLineToPoint(CGPointMake(0, 10.89))
        starPath.addLineToPoint(CGPointMake(-14.69, 20.23))
        starPath.addLineToPoint(CGPointMake(-10.35, 3.36))
        starPath.addLineToPoint(CGPointMake(-23.78, -7.73))
        starPath.addLineToPoint(CGPointMake(-6.4, -8.81))
        starPath.closePath()
        color.setStroke()
        starPath.lineWidth = 5
        starPath.stroke()

        CGContextRestoreGState(context)
    }

