    public class func imageOfSegue(#frame: CGRect, iconColor: UIColor) -> UIImage {
        UIGraphicsBeginImageContextWithOptions(frame.size, false, 0)
            StyleKit.drawSegue(frame: frame, iconColor: iconColor)

        let imageOfSegue = UIGraphicsGetImageFromCurrentImageContext()!.imageWithRenderingMode(UIImageRenderingMode.AlwaysTemplate)
        UIGraphicsEndImageContext()

        return imageOfSegue
    }

